    render() {
        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
          };

        return (
           <Slider {...settings}>
        <div>
            <img style={imgStyle} src={img1} />
